import React, {useState, useEffect}from "react";
import axios from "axios";

// const baseURL = "http://localhost:7000/userData/";
const baseURL = "https://jsonplaceholder.typicode.com/posts/1/comments";

export default function App() {
  const [previous, setNew] = React.useState([]);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setNew(response.data);
    });
  }, []);



  if (!previous) return null;

  console.log(JSON.stringify(previous));
  return (
    <div>
    <h1>Doctor Data to be render</h1>
      <div>{previous.name}</div>
      <div>{previous.email}</div>
      <div>{previous.body}</div>
      {/* <div>{previous.location}</div>
      <div>{previous.phoneNo}</div> */}
    </div>
  );
}
